import React from "react";
import { Line } from "react-chartjs-2";
import "./AgentFilter.css";

function LineChart(){
    const data = {
        labels: ['Mon', 'Tue', 'Wed', 'Thur', 'Fri'],
        datasets: [
            {
                label: 'Calls per week',
                data: [3, 2, 2, 1, 5]
            },
            {
                label: 'Calls per week 2021',
                data: [1, 3, 2, 2, 3]
            }
        ]
    }

    const options = {
        title: {
            display: true, 
            text: 'Line Chart'
        },
        scales: {
            yAxes:[
                {
                    ticks:{
                        min: 0,
                        max: 6,
                        stepSize:1
                    }
                }
            ]
        }
    }

        return <Line data={data}  options={options}/>
}

export default LineChart;
